node.text:
One of our collaborating artists for Meow Wolf Las Vegas and one of the brains behind "Juke Temple." Carey Thompson is committed to art that connects with the world, but Thompson’s art is spectacular because it connects to an aspect of the world which most of us did not even know existed. His art is visually psychedelic and most would say, trippy, but it sets the stage for a unique experience for all.

